import React, { useEffect, useState } from 'react'
// import { useSelector } from 'react-redux'
import { videoService } from '../services/videoService'
import { FavoritePreview } from './FavoritePreview'

export function FavoritesList({ setCurrVideo }) {
    // const { favorites } = useSelector(state => state.listModule)
    const [list, setlist] = useState([])

    useEffect(() => {
        loadFavorites()
    }, [])

    async function loadFavorites() {
        console.log('hey');
        const favorites = await videoService.queryFavorites()
        setlist(favorites)
    }

    // if (!favorites) return <div>Dont have Favorites video </div>
    return (
        <div>
            <p>{list?.map(favo => {
                return <p key={favo.last}>{favo.name}</p>
            })}</p>
            {/* {favorites.map(video => {
                return <FavoritePreview key={video.id.videoId} video={video} setCurrVideo={setCurrVideo} />
            })} */}
        </div>
    )
}
